
import java.util.*;

class Langvec {
	public static void main(String args[])
	{
		// TODO Auto-generated method stub
		Vector list=new Vector();
		int l=args.length;
		int i;
		for(i=0;i<l;i++);
		{
			list.addElement(args[i]);
			System.out.println(args[i]);
		}
		
		
		System.out.println(list);
		
	}

}
